import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import Container from 'react-bootstrap/Container';

import Image from 'react-bootstrap/Image';
import one from '../assets/images/one.jpg';
import two from '../assets/images/two.jpg';
import three from '../assets/images/three.jpg';
import four from '../assets/images/four.jpg';
import five from '../assets/images/five.jpg';
import six from '../assets/images/six.jpg';
import seven from '../assets/images/seven.jpg';
import eight from '../assets/images/eight.jpg';

export default function AppClients() {
    const logos = [
        one,two,three,fours
    ]
    return(

        <section className='clients'>
     <Container>

        <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example" className="mb-3">
           <Tab eventKey="home" title="Home"> 

            <div className='logos'>
                <Image src={one} className='one'/>
                <Image src={two} className='two'/>
                <Image src={three} className='three'/>
                <Image src={four} className='four'/>
                <Image src={five} className='five'/>
                <Image src={six} className='six'/>
                <Image src={seven} className='seven'/>
                <Image src={eight} className='eight'/>

            </div>           
           <Row>
            {
                logos.map((logo,i)=>(
                    <Col md="3" key={i}>
                        <Image src={logo} className='one'/>
                    </Col>
                ))
            }
           </Row>




           </Tab>







           <Tab eventKey="profile" title="Profile">Tab content for Profile</Tab>
           <Tab eventKey="contact" title="Contact">Tab content for Contact</Tab>
        </Tabs>

    </Container>
    </section>
    )
}
